 ('1334', '은행나무길', '36.798606', '127.008736', '36.796678', '127.030886', '은행나무', '487.0', '2.1', '아산 은행나무길은 아산시 염치읍 곡교천을 따라 조성된 길이다. 아산시 충무교에서 현충사 입구까지 총길이 2.1km 구간에 조성된 은행나무 가로수는 1966년 현충사 성역화 사업의 일환으로 전나무가 식재 되었다가  1973년 10여 년생의 은행나무로 교체하여 심은 것이 지금의 은행나무길이 되었다. 2013년까지 차량이 통행하던 길이었으나 대체 도로 조성 후 차없는 거리로 지정하여 도보로만 이용가능하다. 심은지 50여년이 지나 수령이 60년이 넘은 이들 은행나무가로수는 이제 아름드리 나무로 자라 사계절 방문객들의 발길을 멈추게 하고 있다.  은행나무길에는 총 487여 그루가 가로수를 이루고 있으며 사시사철마다 형형색색의 이미지로 관광객들의 발길을 모으고 있다.', 'None', '시도', '충무교북단~백암리643', '041-540-2356', '충청남도 아산시', '2024-07-31', '4520000', '충청남도 아산시'),
